SE NÃO VALE O ESFORÇO ENFRENTAR UMA FILA, UMA VEZ A CADA QUATRO ANOS, PARA VOTAR E IMPEDIR QUE O LADRÃO VOLTE A NOS ROUBAR E DESTRUIR FAMÍLIAS;
😡👉DE REPENTE VALE, PARA NÃO ENFRENTAR A FILA NOS 👉 PRESÍDIO👈 PARA VISITAR O TEU FAMÍLIAR PRESO;
👉 OU NECROTÉRIO, PARA FAZER RECONHECIMENTO DE UM PARENTE QUE FOI ASSALTADO;
👉OU, AINDA, NOS CORREDORES DOS HOSPITAIS DEPREDRADOS PATA CONTRUIR ESTÁDIOS, OU REFINARIAS, PORTOS, ESTRADAS, ETC..., EM OUTROS PAÍSES DOMINADOS POR DITADURAS ESQUERDOPATAS!!!!
🤬👉VOCÊS É QUEM ESCOLHE A FILA QUE QUER ENFRENTAR!!!!!👈🤬
